We will be picking:

🍑🌻🍑🌻🍑🌻🍑🌻🍑🌻🍑

•Cresthaven (Yellow, Freestone Peaches) $2.29 per lb.
•Jersey Queen (Yellow, Freestone Peaches) $2.29 per lb.

🍑🌻🍑🌻🍑🌻🍑🌻🍑🌻🍑

We will have sunflowers 🌻 ($2.50 each or 3 for $6) watermelon 🍉 ($.59 per lb.), local honey, and homemade jams for sale at our stand.

Please remember that you must wear your safety mask, you are not allowed to eat or sample the fruit, non-service animals are not permitted in the orchards, and you must pay for what you pick. 
 
🍑🌻🍑🌻🍑🌻🍑🌻🍑🌻🍑

Listed below you will find our COVID Safety Procedures that will help ensure the safety of our customers and employees. We kindly ask for your patience and understanding as we all navigate these new requirements.

What to expect:
•Increased sanitation throughout the day
•Masks for all team members
•Monitoring and metering guest access
•Requiring masks for all guests
•Reminders for social distancing
 
How you can help:
•Wearing masks
•Practicing social distancing
•Not eating the produce before washing it at home
•Only bringing the family to the farm
•Contacting an Eastmont Employee in case of concern or emergency (look for the people in red shirts!)
•No picnics in the Orchard
•Please follow the Farm Rules listed below:
 
Farm Rules
 
1.  Pay for What You Pick
2.  No Picnics Permitted on the Premises
3.  Shoes and Shirt are Required to Enter
4.  No Backpacks or Large Bags
5.  No Pets 
6.  No Throwing Produce
7.  No Climbing Trees, Wagons, or Machinery
8.  Only Pick Where Indicated
9.  Drive Slowly and Carefully, 10 mph or Less
10.  Be Respectful of the Farm, Employees, Farm Animals, and Other Customers

